<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport"
          content="width=device-width, height=device-height, initial-scale=1, maximum-scale=1, user-scalable=0">
    <title>ERROR 404</title>
</head>
<style>
    a {
        text-decoration: none;
    }

    [class^="iconerror-"],
    [class*="iconerror-"] {
        background-repeat: no-repeat;
        display: inline-block;
        height: 30px;
        width: 30px;
        line-height: 30px;
        vertical-align: middle;
        background-size: 140px 50px
    }

    .iconerror-dmx {
        background-position: 0 0;
        height: 18px;
        width: 103px;
    }

    .iconerror-facebook {
        background-position: -110px 0;
        height: 18px;
        width: 18px;
    }

    .iconerror-tgdd {
        background-position: 0 -25px;
        height: 18px;
        width: 108px;
    }


    .error404 .error-img img {
        max-width: 481px;
        margin-right: 170px;
    }

    .error500 .error-img img {
        max-width: 552px;
    }

    .error404,
    .error500 {
        align-items: center;
        display: flex;
        max-width: 1100px;
        margin: 0 auto;
        padding: 145px 0 130px;
        text-align: center;
    }

    .error404 .error-content {
        margin: 15px 0 0 -40px;
    }

    .error500 .error-content {
        margin: 50px 0 0 -140px;
    }

    .error404 .error-content h3 {
        margin-bottom: 30px;
    }

    .error500 .error-content h3 {
        margin-bottom: 12px;
    }

    .error-content h3 {
        color: #30425B;
        font-size: 48px;
        font-weight: 500;
        line-height: 57px;
    }

    .list-contact {
        display: flex;
        justify-content: center;
    }

    .list-contact .itemct {
        margin: 0 10px;
        width: 130px;
    }

    .list-contact .itemct p {
        color: #666;
        font-size: 12px;
        line-height: 17px;
        margin-bottom: 5px;
    }

    .error-content .link {
        align-items: center;
        border-radius: 20px;
        display: flex;
        justify-content: center;
        height: 40px;
    }

    .error-content .link--blue {
        background-color: #2F80ED;
    }

    .error-content .link--yellow {
        background-color: #FFD400;
    }

    .error-content .link-tel {
        color: #FFF;
        font-size: 16px;
        font-weight: bold;
    }

    .error-content .link-fb {
        color: #FFF;
        font-size: 16px;
    }

    .error-content .link-fb i {
        margin-right: 5px;
    }

    .error-content .txt {
        color: #30425B;
        font-size: 24px;
        line-height: 27px;
        margin-bottom: 15px;
    }
</style>
